import React from 'react';
import './app.scss';
import Header from './components/header';
import Certifications from './components/certifications';
import Headline from './components/headline';
import './app.scss';

const App = () => {
  return (
    <div className="App">
      <Header />
      <section className="headline">
        <Headline />
      </section>
      <Certifications />
    </div>
  );
};

export default App;
